import React from 'react';
import { Link } from 'react-router-dom'; // Assuming you're using React Router for navigation
import '../styles/header.css';

function NavigationBar() {
  return (
    <header className="site-header">
      <nav className="navbar navbar-expand-md navbar-dark bg-steel fixed-top">
        <div className="container">
          <Link className="navbar-brand mr-4" to="/">SURFr</Link>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggle" aria-controls="navbarToggle" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarToggle">
            <div className="navbar-nav mr-auto">
              <Link className="nav-item nav-link" to="/db-upload">Use SURFr</Link>
              <Link className="nav-item nav-link" to="/about">About Us</Link>
            </div>
            {/* Navbar Right Side */}
            <div className="navbar-nav">
              <Link className="nav-item nav-link" to="/howto">How To Use</Link>
              <Link className="nav-item nav-link" to="/faq">FAQ</Link>
            </div>
          </div>
        </div>
      </nav>
    </header>
  );
}

export default NavigationBar;
